C.Ue=new L.y("Turn ON for a white app bar on light theme, a popular design on iOs. This settings overrides all other app bar color selections and disables app bar color selection on custom theme",null,null,null,null,null,null,null,null)
C.Uf=new L.y("White app bar",null,null,null,null,null,null,null,null)
C.Ui=new L.y("Allow location services",null,null,null,null,null,null,null,null)
C.Uj=new L.y("Scroll behind the app bar",null,null,null,null,null,null,null,null)
